import React, { useState, useEffect } from 'react';
import { Link as RouterLink } from 'react-router-dom';
import {
  Grid,
  Card,
  CardContent,
  Typography,
  Button,
  LinearProgress,
  Alert,
  Container,
  Box,
  Divider,
} from '@mui/material';
import { dashboardAPI } from '../services/api';

function Dashboard() {
  const [lastSession, setLastSession] = useState(null);
  const [stats, setStats] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchDashboardData = async () => {
      try {
        setError(null);
        const [sessionRes, statsRes] = await Promise.all([
          dashboardAPI.getLastStudySession().catch(() => ({ data: null })),
          dashboardAPI.getQuickStats().catch(() => ({ data: null })),
        ]);

        setLastSession(sessionRes.data);
        setStats(statsRes.data);
      } catch (error) {
        console.error('Error fetching dashboard data:', error);
        setError('Failed to load dashboard data. Please try again later.');
      } finally {
        setLoading(false);
      }
    };

    fetchDashboardData();
  }, []);

  if (loading) {
    return (
      <Container maxWidth="lg" sx={{ mt: 4 }}>
        <LinearProgress />
      </Container>
    );
  }

  if (error) {
    return (
      <Container maxWidth="lg" sx={{ mt: 4 }}>
        <Alert severity="error">{error}</Alert>
      </Container>
    );
  }

  return (
    <Container maxWidth="lg" sx={{ mt: 4, mb: 4 }}>
      <Grid container spacing={3}>
        {/* Last Study Session */}
        <Grid item xs={12}>
          <Card>
            <CardContent>
              <Typography variant="h6" gutterBottom>
                Last Study Session
              </Typography>
              {lastSession?.has_sessions ? (
                <Box>
                  <Typography variant="body1" gutterBottom>
                    {new Date(lastSession.created_at).toLocaleString()}
                  </Typography>
                  <Typography variant="body2" color="text.secondary" gutterBottom>
                    Activity: {lastSession.activity_name}
                    {lastSession.group_name && ` • Group: ${lastSession.group_name}`}
                  </Typography>
                  <Divider sx={{ my: 1 }} />
                  <Typography variant="body2">
                    Words Studied: {lastSession.stats.total_words}
                    {' • '}
                    Correct: {lastSession.stats.correct_words}
                    {' • '}
                    Accuracy: {lastSession.stats.accuracy}%
                  </Typography>
                </Box>
              ) : (
                <Typography color="text.secondary">
                  No study sessions yet
                </Typography>
              )}
            </CardContent>
          </Card>
        </Grid>

        {/* Study Progress */}
        <Grid item xs={12} md={6}>
          <Card>
            <CardContent>
              <Typography variant="h6" gutterBottom>
                Study Progress
              </Typography>
              {stats ? (
                <Typography>
                  Words studied: {stats.words_studied} / {stats.total_words}
                </Typography>
              ) : (
                <Typography color="text.secondary">
                  No progress data available
                </Typography>
              )}
            </CardContent>
          </Card>
        </Grid>

        {/* Quick Stats */}
        <Grid item xs={12} md={6}>
          <Card>
            <CardContent>
              <Typography variant="h6" gutterBottom>
                Quick Stats
              </Typography>
              {stats ? (
                <>
                  <Typography>Total Groups: {stats.total_groups}</Typography>
                  <Typography>Study Sessions: {stats.study_sessions}</Typography>
                  <Typography>Study Streak: {stats.study_streak} days</Typography>
                </>
              ) : (
                <Typography color="text.secondary">
                  No statistics available
                </Typography>
              )}
            </CardContent>
          </Card>
        </Grid>
      </Grid>

      <Box mt={3}>
        <Button
          variant="contained"
          color="primary"
          component={RouterLink}
          to="/study-activities"
          fullWidth
        >
          START STUDYING
        </Button>
      </Box>
    </Container>
  );
}

export default Dashboard;
